import React from 'react';
import Upload from '../components/Upload';

export default function Dashboard() {
  return (
    <div style={{ 
      maxWidth: '800px', 
      margin: '20px auto', 
      padding: '30px',
      backgroundColor: '#f8f9fa'
    }}>
      <div style={{
        backgroundColor: 'white',
        padding: '30px',
        borderRadius: '8px',
        border: '1px solid #ddd'
      }}>
        <h2 style={{ 
          textAlign: 'center', 
          marginBottom: '30px', 
          color: '#333',
          borderBottom: '2px solid #007bff',
          paddingBottom: '10px'
        }}>Football Coach Dashboard</h2>
        <Upload />
      </div>
    </div>
  );
}
